How can we set the expiry date of all fruits contains the word "Apple"? use sea_orm::entity::prelude::*; #[derive(Clone, Debug, PartialEq, Eq, DeriveEntityModel)]
#[sea_orm(table_name = "fruit")]
pub struct Model { #[sea_orm(primary_key)] pub id: i32, pub name: String, pub expiry: Option<DateTimeWithTimeZone>,
} #[derive(Copy, Clone, Debug, EnumIter, DeriveRelation)]
pub enum Relation {} impl ActiveModelBehavior for ActiveModel {} Since update one only takes value instead of expression. We need update many for this purpose. use sea_orm::sea_query::Expr; // UPDATE `fruit` SET `expiry` = CURRENT_TIMESTAMP WHERE `fruit`.`name` LIKE '%Apple%'
fruit::Entity::update_many() .col_expr(fruit::Column::Expiry, Expr::current_timestamp()) .filter(fruit::Column::Name.contains("Apple")) .exec(db) .await?;

